import React from 'react';
import './Bakery.css';
import { Outlet, Link } from "react-router-dom";
import logo from './Images/what.jpg';
import home15 from './Images/upload.png';
import phone from './Images/phone.svg';
import email from './Images/email.svg';
import face from './Images/facebook.svg';
import tiwt from './Images/twitter.svg';
import linked from './Images/linkedin.svg';
import insta from './Images/instagram.svg';


function Home(){
    return(
        <>
        <header class="header fixed-top" id="Bakeryhome">
			<nav class="na navbar navbar-expand-md">
			<div class="container-fluid">
				<div class="logo">
					<img src={logo} alt='logo' width='80px' height='80px'/>
				</div>
				<div class="collapse navbar-collapse" id="mynav">
					<ul class="link ms-auto me-5">
						<li class="list"><a href="#" class="anchor1 active">HOME</a></li>
						<li class="list"><a href="#Aboutus" class="anchor2 active" >ABOUT US</a></li>
						<li class="list"><a href="#Product" class="anchor3 active">OUR PRODUCTS</a></li>
						<li class="list"><a href="#Specialities" class="anchor3 active">OUR SPECIALITIES</a></li>
						<li class="list"><a href="#Order" class="anchor4 active">ORDER</a></li>
					</ul>
				</div>
			</div>
			</nav>
		</header>
        <Outlet />
        </>
    );
}

function Order(){
	return(
		<>
		<section class="want-order" id="Order">
			<h1>LIKE OUR PRODUCT ?</h1>
			<p>Treat yourself to your favourite Delight products or surprise your loved ones with an edible gift.</p>
			<button class="card_btn rounded-pill">ORDER ONLINE</button>
		</section>

		<a href="#Bakeryhome" class="go-to-top">
			<img src={home15} width="15px" />
		</a>
		</>
	);
}

export {Home};
